this.Be=(new y).k("CanopyGreen Room","This cavernous greenhouse has long since become a jungle.\nAmazonian Web Services are provided by giant spiders, luckily for you they eat insects not mammals (well, unless you are a bug, then it's unlucky for you).\nThere are passages to the west and east;\nto the northwest and northeast, stairs spiral upwards.");this.ee=(new y).k("Ochre Room","Ochre cliffs reminiscent of Uluru (/Ayers Rock) rise around you in a Martian landscape.\nYou feel the urge to make face-paints from the dusty-orange hematite soils around you.\nThere are passages to the north and south;\nto the west, stairs spiral downwards; to the northeast and southeast, stairs spiral upwards.");
this.Dd=(new y).k("Maroon(X11) Room",'You can easily feel a bit marooned (bop tish!) all alone here in this large, musty room with its mouldy peeling wallpaper.\nFor colour-geeks, try googling (in the meta-world outside of this game): "wiki X11 colour name clashes".\nThere are passages to the north, east, and west;\nto the southeast and southwest, stairs spiral upwards.');this.Ue=(new y).k("Violet Room",'If you rub your eyes, you can maybe get your cone-cells to generate little pinpoints of "deep blue-violet" colour.\nAlthough from a physical view, near-monochromatic violet and non-monochromatic purple spectral distributions are rather different,\nperceptually (for us) these colours involve no colour-solid-discontinuity. So we can have our colour-wheels, and so on. Anyway back to the game...\nThere are passages to the east and west;\nto the southeast and southwest, stairs spiral upwards.');
